import './App.css';
import Header from './components/Header';
import Movie from './components/Movie';
import movies from './movie.json';

function App() {
  return (
    <div className="App">
    <Header 
    />

    <div className='main'>
     return ( {
        movies.map((item) => {
          <Movie 
            title={item.title}
          />
        })
      }) 
    </div>

    <Movie />
    </div>
  );
}

export default App;
